import styled from 'styled-components'

export const ComposeMessageBoxWrapper = styled.div`
  height: 70px;
  background: #414041 0% 0% no-repeat padding-box;
  box-shadow: 0px -2px 8px #0000000f;
  border-radius: 10px 10px 0px 0px;
  position: absolute;
  left: 185px;
  right: 0;
  bottom: 0;
`

export const TextInputWrapper = styled.div`
  text-align: center;
  padding-left: 50px;
  padding-right: 50px;
  margin-right: 50px;
  top: 12px;
  width: 100%;
  position: absolute;
  left: 10px;
  border-width: 0px;
  border-radius: 230px;
  color: white;
`

export const UserImgWrapper = styled.img`
  margin-top: 9px;
  margin-left: 10px;
  top: 0px;
  height: 40px;
  width: 40px;
  background-color: white;
  border-radius: 230px;
  position: absolute;
`

export const EmojiInputWrapper = styled.img`
  margin-top: 14px;
  margin-left: 0px;
  right: 50px;
  top: 2px;
  height: 35px;
  width: 35px;
  position: absolute;
`
